import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class TodoList extends Component {

    constructor(props) {
        super(props);
        this.state = {todos: []};
    }

    render() {
        return (
            <div>
                <p>Welcome to Todo List Component!</p>
            </div>
        )
    }
}
